class BuyCard extends Component {

    componentDidMount() {
        window.scrollTo(0, 0)
    }


    render() {
        return (
            <div>
                <div className="buy-card-page">
                    <div className="container">
                        <div className="row">
                            <div className="col-md-4">
                                <div className="white-box">
                                    <div class="buy-cart-type">MEMBERSHIP CARD</div>
                                </div>
                            </div>
                            <div className="col-md-4">
                                <div className="white-box p-4 buy-card-form">
                                    <div className="row">
                                        <div className="col-md-12">
                                            <div className="form-group">
                                                <label>Full Name</label>
                                                <input type="text" className="form-control" />
                                            </div>
                                        </div>
                                        <div className="col-md-12">
                                            <div className="form-group">
                                                <label>Phone</label>
                                                <input type="text" className="form-control" />
                                            </div>
                                        </div>
                                        <div className="col-md-12">
                                            <div className="form-group">
                                                <label>Email</label>
                                                <input type="text" className="form-control" />
                                            </div>
                                        </div>
                                        <div className="col-md-12">
                                            <div className="form-group">
                                                <label>Select Amount</label>

                                                <select className="form-control">
                                                    <option>₹ 500</option>
                                                    <option>₹ 1000</option>
                                                    <option>₹ 2000</option>
                                                    <option>₹ 5000</option>
                                                </select>
