                                    </div>

                                </div>
                            </div>
                            <div className="col-md-4">
                                <div className="white-box p-3">
                                    <img src="./images/membership-card.png" className="img-thumbnail" alt="" />
                                    <div className="jumbotron text-center mt-3 p-4">
